                </div>
                <div className='right-block'>
                    <p>Phone</p> 
                    <p>rs 999</p> 
                    <p>Qty:1</p> 
                    <div className='cart-item-actions'>

                    </div>
                </div>
            </div>
        )
    }
}

const styles={
    image:{
        height:110,
        width:110,
        borderRadius:4
    }
}
